var so_utils =
{
    appear: function (id) { document.getElementById(id).style.opacity = 1; },
    disappear: function (id) { document.getElementById(id).style.opacity = 0; },
    printPkmn: function (pkmn) {
        var c = pkmn.constraints;
        if (c == null)
            return (pkmn.HPEVs + '/' + Object.values(pkmn.evs).join('/') + '<br>' + pkmn.nature + '<br>' + (pkmn.item === "" ? '@--' : '@' + pkmn.item));
        else
            if (c.problem === 'max') {
                var movehtml, boosthtml = (c.boost == null || c.boost === '+0')? '' : ' at <b>' + c.boost + '</b>';
                if (c.move == null || so_subject_pkmn == null) movehtml = '<span style="color:#AAA">⚠ Choose a Move ⚠</span>'; else
                    movehtml = '<span style="color:#AAA">'+ (pkmn.constraints.dyna? 'MAX ' : '') + so_subject_pkmn.moves[c.move].name + boosthtml +'</span>';
                if (c.type === 'optim')
                    return '<span style="color:#F77">Maximize Damage With</span><br>' + movehtml;
                if (c.type === 'classif')
                    return '<span style="color:#F77">At least <b>' + c.soglia + '% With</b></span><br>' + movehtml;
            } else
                if (c.problem === 'min') {
                    var movehtml, boosthtml = (c.boost == null || c.boost === '+0')? '' : ' at <b>' + c.boost + '</b>';
                    if (c.move == null) movehtml = '<span style="color:#AAA">⚠ Choose a Move ⚠</span>'; else
                        movehtml = '<span style="color:#AAA">' + (pkmn.moves[c.move].isMax ? 'MAX ' : '') + pkmn.moves[c.move].name + boosthtml +'</span>';

                    if (c.type === 'optim')
                        return '<span style="color:#7F7">Minimize Damage From</span><br>' + movehtml;
                    if (c.type === 'classif')
                        return '<span style="color:#7F7">At most <b>' + c.soglia + '%</b> From</span><br>' + movehtml;
                } else
                    if (c.problem === 'speed') {
                        return '<span style="color:#77F">Outspeed when at <b>' + c.boost + '</b></span>';
                    } else return '<span style="color:#AAA">⚠ Choose a Constraint ⚠<br>⚠ Choose a Move ⚠</span>';

    },
    openFile: function (func) {
        function clickElem(elem) {
            // Thx user1601638 on Stack Overflow (6/6/2018 - https://stackoverflow.com/questions/13405129/javascript-create-and-save-file )
            var eventMouse = document.createEvent("MouseEvents")
            eventMouse.initMouseEvent("click", true, false, window, 0, 0, 0, 0, 0, false, false, false, false, 0, null)
            elem.dispatchEvent(eventMouse)
        }
        readFile = function(e) {
            var file = e.target.files[0];
            if (!file) {
                return;
            }
            var reader = new FileReader();
            reader.onload = function(e) {
                var contents = e.target.result;
                fileInput.func(contents)
                document.body.removeChild(fileInput)
            }
            reader.readAsText(file)
        }
        fileInput = document.createElement("input")
        fileInput.type='file'
        fileInput.style.display='none'
        fileInput.onchange=readFile
        fileInput.func=func
        document.body.appendChild(fileInput)
        clickElem(fileInput)
    },
    saveFile: function(text,file) {
        var element = document.createElement('a'); 
        element.setAttribute('href', 'data:text/plain;charset=utf-8, ' 
                            + encodeURIComponent(text)); 
        element.setAttribute('download', file); 
        document.body.appendChild(element); 
        element.click(); 
        document.body.removeChild(element);
    }
}

so_popup = function (what) {
    if (what === 'info')
    window.open('info.html',"Tech Info","config='toolbar=no, menubar=no,scrollbars=yes,resizable=yes,location=no,directories=no,status=no'");
    if (what === 'help')
    window.open('help.html',"Help","config='toolbar=no, menubar=no,scrollbars=yes,resizable=yes,location=no,directories=no,status=no,width=750,height=500'");
}

