var firstLoad = false;
function persistentList(storagekey, updatefunction) {
    return {
        init: function () { var s = this.get(); if (s == null) this.set([]); else updatefunction(s); },
        initObj: function () {var s = this.get(); if (s == null) {this.set({}); firstLoad = true; }},
        get: function () { return JSON.parse(window.localStorage.getItem(storagekey)) },
        set: function (value) {
            window.localStorage.setItem(storagekey, JSON.stringify(value));
            updatefunction(value);
        },
        push: function (item) { var s = this.get(); s.push(item); this.set(s); },
        delete: function (index) { var s = this.get(); s.splice(index, 1); this.set(s); },
        delegate: function (action) { var s = this.get(); s=action(s); this.set(s); }
    };
}
