so_save = function (p1orp2) {

    var pkmn = new Pokemon($('#' + p1orp2)); pkmn['ivs'] = {}; pkmn['base'] = {};
    pkmn.nick = prompt("Enter a name for this Pokemon:", pkmn.name);
    if (pkmn.nick == null || pkmn.nick == "") {
        return;
    } else {
        var pokeObj = $(".set-selector").closest(".poke-info");
        for (i = 0; i < STATS.length; i++) {
            pkmn['ivs'][STATS[i]] = ~~pokeObj.find("." + STATS[i] + " .ivs").val();
            pkmn['base'][STATS[i]] = ~~pokeObj.find("." + STATS[i] + " .base").val();
        }
        pkmn['HPIVs'] = ~~pokeObj.find(".hp .ivs").val();
        pkmn['HPBase'] = ~~pokeObj.find(".hp .base").val();
        if (pkmn.isDynamax) pkmn.moves.forEach(move => {move.isMax = true;});
        so_saved_pokes.push(pkmn);
        so_toggleNav('sx');
    }
}

/* Toggle the two sidebars by setting their width*/
var so_sidebar = { 'sx': false, 'dx': false };
function so_toggleNav(sxdx) {
    var symbol = sxdx === 'dx' ? "&#128437;" : "&#9776"
    if (!so_sidebar[sxdx]) {
        document.getElementById(sxdx + "Sidebar").style.width = "250px";
        if (sxdx === 'sx') {
            document.getElementById("sxSidebar").style.paddingLeft = "62px";
        } else {
            setTimeout(function() {document.querySelectorAll('.algorithm').forEach(el => {el.style.opacity=1; el.style.width='60px'})},500);
        }
        setTimeout(function () { so_utils.appear(sxdx + "wrap"); }, 500);
        document.getElementById("close" + sxdx).innerHTML = "&times;";
        so_sidebar[sxdx] = true;
    } else {
        document.getElementById(sxdx + "Sidebar").style.width = "0px";
        if (sxdx === 'sx') {
            document.getElementById("sxSidebar").style.paddingLeft = "0px";
        } else {
            document.querySelectorAll('.algorithm').forEach(el => {el.style.opacity=0;el.style.width='0px'});
        }
        so_utils.disappear(sxdx + "wrap");
        document.getElementById("close" + sxdx).innerHTML = symbol;
        so_sidebar[sxdx] = false;
    }
}

