var so_del = function (id) { if (confirm("Do you want to delete this pokemon?")) this.so_saved_pokes.delete(id); };
var so_edit = function (id, lr) {
    var set = this.so_saved_pokes.get()[id];
    $(".set-selector").eq(lr === 'left' ? 1 : 3).val(set.name + ' (Blank Set)');
    $(".set-selector").eq(lr === 'left' ? 1 : 3).change();
    $(".select2-chosen").eq(lr === 'left' ? 0 : 5).text(set.name + ' (Blank Set)');
    var pokeObj = $(".set-selector").eq(lr === 'left' ? 1 : 3).closest(".poke-info");
    var moveObj;
    var abilityObj = pokeObj.find(".ability");
    var itemObj = pokeObj.find(".item");
    setSelectValueIfValid(pokeObj.find(".nature"), set.nature, "Hardy");
    setSelectValueIfValid(abilityObj, set.ability, "");
    setSelectValueIfValid(itemObj, set.item, "");
    for (i = 0; i < 4; i++) {
        moveObj = pokeObj.find(".move" + (i + 1) + " select.move-selector");
        setSelectValueIfValid(moveObj, set.moves[i].name, "(No Move)");
        moveObj.change();
        $((lr === 'left'? '#maxL' : '#maxR')+(i+1)).prop('checked', set.moves[i].isMax);
    }
    $(lr === 'left'? '#maxL' : '#maxR').prop('checked', set.isDynamax);
    pokeObj.find(".hp .evs").val((set.evs && typeof set.HPEVs !== "undefined") ? set.HPEVs : 0);
    pokeObj.find(".hp .ivs").val((set.ivs && typeof set.ivs.hp !== "undefined") ? set.HPIVs : 31);
    pokeObj.find(".hp .evs").change();
    for (i = 0; i < STATS.length; i++) {
        pokeObj.find("." + STATS[i] + " .evs").val((set.evs && typeof set.evs[STATS[i]] !== "undefined") ? set.evs[STATS[i]] : 0);
        pokeObj.find("." + STATS[i] + " .ivs").val((set.ivs && typeof set.ivs[STATS[i]] !== "undefined") ? set.ivs[STATS[i]] : 31);
        pokeObj.find("." + STATS[i] + " .ivs").change();
    }
    so_toggleNav('sx');
}
