var so_comboPresets;
function so_update_comboPresets() {
    var s = this.so_presets.get();
    var selected = s['__selected__'];
    so_comboPresets = Object.keys(s).map(presetname => {
        if (presetname.startsWith('_')) return '';
        return '<option value="' + presetname + '" ' + (presetname === selected ? 'selected="selected"' : '') + '>'+ presetname + '</option>';

    }).join('');
    this.so_monitor_update();
}

function so_loadPreset(key) {
    this.so_presets.delegate(s => {
            if (s[key] === undefined || key === undefined || key.startsWith('_')) return s;
            s[s['__selected__']]['subject']=so_subject_pkmn;
            s[s['__selected__']]['constraints']=(so_constraints.get() || []);
            so_subject_pkmn = s[key]['subject'];
            if (so_subject_pkmn == null) window.localStorage.setItem('subject_pkmn',null);
            else window.localStorage.setItem('subject_pkmn',JSON.stringify(so_subject_pkmn));
            so_constraints.set(s[key]['constraints'] || []);
            s['__selected__'] = key;
            this.so_monitor_update();
            return s;
    });

}

window.onbeforeunload = function() {
    this.so_presets.delegate(s => {
        s[s['__selected__']]['subject']=so_subject_pkmn;
        s[s['__selected__']]['constraints']=(so_constraints.get() || []);
        return s;
    });
}

function so_deletePreset() {
    if (this.so_presets.get()['__selected__'] === 'default') {alert("You cannot delete the default preset."); return;}
    if (!confirm("Do you really want to delete this preset?")) return;
    this.so_presets.delegate(s => {
        
        var key = s['__selected__'];
        if (s[key] === undefined || key === undefined || key.startsWith('_')) return s;
        delete s[key];
        var newKey = Object.keys(s)[0];
        so_subject_pkmn = s[newKey]['subject'];
        if (so_subject_pkmn == null) window.localStorage.setItem('subject_pkmn',null);
        else window.localStorage.setItem('subject_pkmn',JSON.stringify(so_subject_pkmn));
        so_constraints.set(s[newKey]['constraints'] || []);
        s['__selected__'] = newKey;
        this.so_monitor_update();
        return s;  
    });

}

function so_restorePreset() {
    this.so_presets.delegate(s => {
        var key = s['__selected__'];
        if (s[key] === undefined || key === undefined || key.startsWith('_')) return s;
        so_subject_pkmn = s[key]['subject'];
        if (so_subject_pkmn == null) window.localStorage.setItem('subject_pkmn',null);
        else window.localStorage.setItem('subject_pkmn',JSON.stringify(so_subject_pkmn));
        so_constraints.set(s[key]['constraints'] || []);
        s['__selected__'] = key;
        this.so_monitor_update();
        return s;
    });
}


function so_newPreset() {
    var name;
    this.so_presets.delegate(s => {
        
        var i = 0;
        while (s['Preset_#'+i] !== undefined) i++;
            name = prompt("Choose a name for the new preset",('Preset_#'+i));
        while (s[name] !== undefined || name.startsWith('_')) 
            name = prompt("Name already taken or invalid. Choose another name.",name);
        s[name]={'constraints':[]};
        return s;
    });
    this.so_loadPreset(name);
}

function so_changePreset(selectObj) {
    var selectIndex=selectObj.selectedIndex;
    var selectValue=selectObj.options[selectIndex].text;
    this.so_loadPreset(selectValue);
}

