so_closeModal = function (save) {
    var effectivelyClose = function () {
        var modal = document.getElementById("myModal");
        modal.style.display = "none";
    }
    var valid = true;
    if (save) {
        so_constraints.delegate(s => {
            var pkmn = s[so_modal_id];
            var problem = document.getElementById('combo').value;
            if (problem !== 'speed') {
                var type = document.querySelector('input[name="radio"]:checked').value;
                var soglia = parseInt(document.getElementById('textbox').value);
                var boost = document.getElementById('minicombo').value;
                var dyna = document.getElementById('dyna').checked;
                var edyna = document.getElementById('edyna').checked;
                var move;
                if (document.getElementById('movecombo') != null)
                    move = document.getElementById('movecombo').value;
                if ((soglia == null || soglia === '') && (type === 'classif')) { alert("Write down a percentage threshold."); valid = false; return; }
                if (isNaN(soglia) && (type === 'classif')) { alert("Invalid threshold."); valid = false; return; }
                if ((soglia < 0 || soglia > 100) && (type === 'classif')) { alert("Invalid threshold."); valid = false; return; }
                pkmn.constraints = {};
                pkmn.constraints.problem = problem;
                pkmn.constraints.type = type;
                pkmn.constraints.soglia = soglia;
                pkmn.constraints.move = move;
                pkmn.constraints.boost = boost;
                pkmn.constraints.dyna = dyna;
                pkmn.isDynamax = edyna; pkmn.moves.forEach(move => { move.isMax = edyna;});
                
                

            }
            else {
                var boost = document.getElementById('minicombo').value;
                pkmn.constraints = {};
                pkmn.constraints.problem = problem;
                pkmn.constraints.boost = boost;
            }

            s[so_modal_id] = pkmn;
            return s;

        });
    }
    if (valid) effectivelyClose();
}

