var so_calcStats = function(pkmn, hpev, statsev) {
    var natureMods = NATURES[pkmn.nature];
    for (var i = 0; i < STATS.length; i++){
        var nature = natureMods[0] === STATS[i] ? 1.1 : natureMods[1] === STATS[i] ? 0.9 : 1;
        pkmn.rawStats[STATS[i]] = Math.floor((Math.floor((pkmn.base[STATS[i]] * 2 + pkmn.ivs[STATS[i]] + Math.floor(statsev[i] / 4)) * pkmn.level / 100) + 5) * nature);
    }
    if (pkmn.HPBase === 1) {
        pkmn.maxHP = 1;
    } else {
        pkmn.maxHP = Math.floor((pkmn.HPBase * 2 + pkmn.HPIVs + Math.floor(hpev / 4)) * pkmn.level / 100) + pkmn.level + 10;
        if (pkmn.isDynamax === true) pkmn.maxHP *= 2;
        
    }
    pkmn.curHP = pkmn.maxHP
}

var so_dynacheck = function(pkmn) {
    if (pkmn.constraints.dyna === true) {
        this.so_subject_pkmn.isDynamax = true;
        this.so_subject_pkmn.moves.forEach(move => { move.isMax = true;});
    }
    if (pkmn.constraints.dyna === false) {
        this.so_subject_pkmn.isDynamax = false;
        this.so_subject_pkmn.moves.forEach(move => { move.isMax = false;});
    }
}


function so_calculateMove(p1, p2, move, constraints, field) {
        checkAirLock(p1, field);
        checkAirLock(p2, field);
        checkForecast(p1, field.getWeather());
        checkForecast(p2, field.getWeather());
        checkKlutz(p1);
        checkKlutz(p2);
        checkSeeds(p1, field);
        checkSeeds(p2, field);
        p1.stats['df'] = getModifiedStat(p1.rawStats['df'], p1.boosts['df']);
        p1.stats['sd'] = getModifiedStat(p1.rawStats['sd'], p1.boosts['sd']);
        p1.stats['sp'] = getFinalSpeedSM(p1, field.getWeather(), field.getTerrain());
        p2.stats['df'] = getModifiedStat(p2.rawStats['df'], p2.boosts['df']);
        p2.stats['sd'] = getModifiedStat(p2.rawStats['sd'], p2.boosts['sd']);
        p2.stats['sp'] = getFinalSpeedSM(p2, field.getWeather(), field.getTerrain());

        p1.boosts['at'] = parseInt(constraints.boost);
        p1.boosts['sa'] = parseInt(constraints.boost);
        p1.stats['at'] = getModifiedStat(p1.rawStats['at'], p1.boosts['at']);
        p1.stats['sa'] = getModifiedStat(p1.rawStats['sa'], p1.boosts['sa']);
        p2.stats['at'] = getModifiedStat(p2.rawStats['at'], p2.boosts['at']);
        p2.stats['sa'] = getModifiedStat(p2.rawStats['sa'], p2.boosts['sa']);
        var side1 = field.getSide(1);
        var side2 = field.getSide(0);
        checkInfiltrator(p1, side1);
        checkInfiltrator(p2, side2);
        return GET_DAMAGE_SM(p1, p2, p1.moves[move], side1); 
}
var qconstraints;
var so_damageForAllConstraints = function (hp, at, df, as, ds, allowrolls, field) {

    var hpev = Math.max(Math.min (hp, 252),0);
    var atev = Math.max(Math.min (at, 252),0);
    var dfev = Math.max(Math.min (df, 252),0);
    var asev = Math.max(Math.min (as, 252),0);
    var dsev = Math.max(Math.min (ds, 252),0);
    var inflicted_percent_damage = 0;
    var suffered_percent_damage = 0;
    var something_to_minimize = 0;
    var something_to_maximize = 0;
    var cobyla_stats = [[],[]]; //[damage], [constraint1, constraint2, ecc]


    qconstraints.forEach(constraint_pkmn => { 

        so_dynacheck(constraint_pkmn);
        so_calcStats(so_subject_pkmn, hpev, [atev, dfev, asev, dsev, 0]);
        if (constraint_pkmn.constraints.problem === 'max') {
                var result  = so_calculateMove(so_subject_pkmn, constraint_pkmn, constraint_pkmn.constraints.move, constraint_pkmn.constraints, field);
                minDamage = result.damage[0] * so_subject_pkmn.moves[constraint_pkmn.constraints.move].hits;
                maxDamage = result.damage[result.damage.length-1] * so_subject_pkmn.moves[constraint_pkmn.constraints.move].hits;
                minPercent = Math.floor(minDamage * 1000 / constraint_pkmn.maxHP) / 10;
                maxPercent = Math.floor(maxDamage * 1000 / constraint_pkmn.maxHP) / 10;
                referred_percentage = Math.min(minPercent,100);
            
            if (constraint_pkmn.constraints.type === 'classif') 
            {
                referred_percentage = allowrolls[0] ? Math.min(maxPercent,100) : Math.min(minPercent,100);
                something_to_maximize += referred_percentage
                cobyla_stats[1].push(referred_percentage - constraint_pkmn.constraints.soglia);
            }
            else inflicted_percent_damage+= referred_percentage;
            
        }
        if (constraint_pkmn.constraints.problem === 'min') {
                var result  = so_calculateMove(constraint_pkmn, so_subject_pkmn,  constraint_pkmn.constraints.move, constraint_pkmn.constraints, field);
                minDamage = result.damage[0] * constraint_pkmn.moves[constraint_pkmn.constraints.move].hits;
                maxDamage = result.damage[result.damage.length-1] * constraint_pkmn.moves[constraint_pkmn.constraints.move].hits;
                minPercent = Math.floor(minDamage * 1000 / so_subject_pkmn.maxHP) / 10;
                maxPercent = Math.floor(maxDamage * 1000 / so_subject_pkmn.maxHP) / 10;
                referred_percentage = Math.min(minPercent,100);

                if (constraint_pkmn.constraints.type === 'classif') {
                    referred_percentage = allowrolls[1] ? Math.min(minPercent,100) : Math.min(maxPercent,100);
                    something_to_minimize += referred_percentage;
                    cobyla_stats[1].push(-referred_percentage + constraint_pkmn.constraints.soglia );
                }
                else suffered_percent_damage+= referred_percentage;
        }


    });
    something_to_minimize = something_to_minimize === 0 ? 1 : something_to_minimize;
    something_to_maximize = something_to_maximize === 0 ? 1 : something_to_maximize;
    inflicted_percent_damage = inflicted_percent_damage === 0 ? something_to_maximize : inflicted_percent_damage;
    suffered_percent_damage = suffered_percent_damage === 0? something_to_minimize : suffered_percent_damage;
    cobyla_stats[0].push(suffered_percent_damage / inflicted_percent_damage);
    return (cobyla_stats);
}

function so_outspeed_check() {
    var max_speed_to_outspeed=0;
    var dedicated_evs=-1;
    so_constraints.get().forEach(pkmn => {
        if (pkmn.constraints.problem === 'speed') {
            var speed = getModifiedStat(pkmn.rawStats['sp'], parseInt(pkmn.constraints.boost));
            max_speed_to_outspeed = speed > max_speed_to_outspeed ? speed : max_speed_to_outspeed;
        }
    });

    for (var i = 0; i <=63; i++) {
        so_calcStats(so_subject_pkmn, 0, [0, 0, 0, 0, i*4]);
        var myspeed = so_subject_pkmn.rawStats['sp'];
        if (myspeed > max_speed_to_outspeed) {dedicated_evs = i*4; break;}
    }

    return dedicated_evs;
}

var so_choiceNatures = function() {
    var fis=0, spe=0, nerfedStat;
    so_subject_pkmn.moves.forEach(move => {
        if (move.category === 'Physical') fis++; 
        if (move.category === 'Special') spe++;       
    });
    if (spe < fis) nerfedStat = 'sa';
    else nerfedStat = 'at';
    if (so_subject_pkmn.ivs['sp']===0) nerfedStat = 'sp';
    var papablenatures = (Object.entries(NATURES).map(n => [n[0], n[1][1]])).filter(nerfed => nerfed[1] === nerfedStat).map(e => e[0]);
    return papablenatures;
}

var so_allSpreads = function() {
    var field = new Field();
    qconstraints = this.so_constraints.get();
    var points_fixed_in_speed;
    var allowrollsatt =  document.getElementById('allowrollsatt').checked;
    var allowrollsdef =  document.getElementById('allowrollsdef').checked;
    if (allowrollsatt == null) allowrollsatt = false;
    if (allowrollsdef == null) allowrollsdef = false;
    var wasdyna = so_subject_pkmn.isDynamax;

    var maxspeed = document.getElementById('maxspeed').checked;
    if (maxspeed == null || maxspeed == false) {
        points_fixed_in_speed = so_outspeed_check()/4;
        if (points_fixed_in_speed < 0) {alert("You asked for an impossible speed."); return;}
    } else {
        points_fixed_in_speed = document.getElementById('fixedspeed').value;
        if (points_fixed_in_speed == null || isNaN(parseInt(points_fixed_in_speed)) || points_fixed_in_speed < 0 || points_fixed_in_speed > 252) {alert("Invalid Speed EVs."); return;}       
        points_fixed_in_speed = Math.floor(points_fixed_in_speed / 4);
    }
    var natures = so_choiceNatures(points_fixed_in_speed);
    if (document.getElementById('fixednature').checked) natures = [document.getElementById('monitornature').value];
    var results = [[],[]];

    natures.forEach(natura => {

            var n=5; 			// + of variables
            var x=new Array(n);
            var m=12; 			// number of constraints
            so_constraints.get().forEach(v => {if (v.constraints.type === "classif") m++;});
            var rhobeg = 63.0;	// Various Cobyla constants, see Cobyla docs in Cobyja.js
            var rhoend = 1.0e-6;;
            var iprint = 0;
            var maxfun = 3500;

            so_subject_pkmn.nature = natura;

            function objective(n,m,x,con) {  	// objective function
                con[0]=(x[0] + x[1] + x[2] + x[3] + x[4] - 127 + points_fixed_in_speed)*10;
                con[1]=-(x[0] + x[1] + x[2] + x[3] + x[4] - 127 + points_fixed_in_speed)*10;
                con[2]=-(x[0] -63)*10;
                con[3]=-(x[1] -63)*10;
                con[4]=-(x[2] -63)*10;
                con[5]=-(x[3] -63)*10;
                con[6]=-(x[4] -63)*10;
                con[7]=x[0]*10;
                con[8]=x[1]*10;
                con[9]=x[2]*10;
                con[10]=x[3]*10;
                con[11]=x[4]*10; 
                var cobyla_stats = so_damageForAllConstraints(x[0]*4,x[1]*4,x[2]*4,x[3]*4,x[4]*4,[allowrollsatt,allowrollsdef],field); 
                var idx=12;
                cobyla_stats[1].forEach(dmenos => {
                    con[idx]=dmenos;
                    idx++;
                });
                return cobyla_stats[0][0]; // objective function 
                }


            x[0]=0; x[1]=0; x[2]=0; x[3]=0; x[4]=0;
            var r=FindMinimum(objective, n,  m, x, rhobeg, rhoend,  iprint,  maxfun);
            var partial_cobyla = so_damageForAllConstraints(x[0]*4,x[1]*4,x[2]*4,x[3]*4,x[4]*4,[allowrollsatt,allowrollsdef],field);
            if (results[0][0] === undefined || results[0][0][0] > partial_cobyla[0][0]) results = [partial_cobyla, x, natura]; 


    });
    so_subject_pkmn.nature = results[2]; 
    document.getElementById('monitornature').value = results[2];
    var x = results[1];
    var final_cobyla = results[0];
    x = x.map(xx => Math.round(xx*2)*2);
    this.activeField = field;
    if (x.every(ev => (ev >= 0 && ev <=252)) && (x[0] + x[1] + x[2] + x[3] + x[4] + points_fixed_in_speed*4 <= 511)) {
        so_report(x[0],x[1],x[2],x[3],x[4],(points_fixed_in_speed*4),allowrollsatt,allowrollsdef);
        document.getElementById('freetuner').innerHTML = '';
        if(final_cobyla[1].every(c => c >= 0)) 
            document.getElementById('reportscreen').innerHTML= '<span style="font-size:small"><span style="color:#7F7">Total success!</span><span style="color:#AAA;"> Best spread:  N. ' + so_subject_pkmn.nature + ' - ' + x.join('/') + '/'+ (points_fixed_in_speed*4) + ' </span>';
        else 
            document.getElementById('reportscreen').innerHTML= '<span style="font-size:small"><span style="color:#F77">Not the best, </span><span style="color:#AAA;"> but my best: N. ' + so_subject_pkmn.nature + ' - ' + x.join('/') + '/'+ (points_fixed_in_speed*4)+ ' </span>';
         this.lastbestspread = [x[0],x[1],x[2],x[3],x[4],(points_fixed_in_speed*4),results[2],document.getElementById('reportscreen').innerHTML,results[0][0][0]];
    }
    else alert("Your request is impossible to satisfy.");
    this.so_subject_pkmn.isDynamax = wasdyna;
    this.so_subject_pkmn.moves.forEach(move => { move.isMax = wasdyna;});
}


function so_fullSearch() {
    var isNatureFixed = document.getElementById('fixednature').checked;
    if (!confirm("This functionality allows you to find the optimal solution by searching all the possible EV Spreads and selecting the one that minimizes the input damage and maximizes the output damage. This guarantees that the optimal spread is found. This operation may take several minutes. Do not close the browser's page until it's done. The page may seem frozen during the process. Are you sure you want to proceed?")) return;
    if (!isNatureFixed) if (!confirm("Is advisable to choose a fixed nature to minimize the scanning time, otherwise the scanning time will increase by 3 or 4 times. Do you still want to proceed?")) return;
    //loading
    document.getElementById("reportModal").style.display = "block";
    var html = '<div id="reportscreen"><span style="color:#AAA">Scanning all the possible spreads...</span></div><hr><br><progress style="width:100%" id="progress" value="0" max="100">0%</progress>';
    var modalC = document.getElementById('reportContent'); modalC.innerHTML = html;

    //setup
    var field = new Field();
    var points_fixed_in_speed;
    var allowrollsatt =  document.getElementById('allowrollsatt').checked;
    var allowrollsdef =  document.getElementById('allowrollsdef').checked;
    if (allowrollsatt == null) allowrollsatt = false;
    if (allowrollsdef == null) allowrollsdef = false;
    var wasdyna = so_subject_pkmn.isDynamax;
    qconstraints = this.so_constraints.get();
    this.terminateFullSearch = false;
    document.getElementById('freetuner').innerHTML = '';

    //Speed
    var maxspeed = document.getElementById('maxspeed').checked;
    if (maxspeed == null || maxspeed == false) {
        points_fixed_in_speed = so_outspeed_check();
        if (points_fixed_in_speed < 0) {alert("You asked for an impossible speed."); return;}
    } else {
        points_fixed_in_speed = document.getElementById('fixedspeed').value;
        if (points_fixed_in_speed == null || isNaN(parseInt(points_fixed_in_speed)) || points_fixed_in_speed < 0 || points_fixed_in_speed > 252) {alert("Invalid Speed EVs."); return;}       
        points_fixed_in_speed = Math.floor(points_fixed_in_speed/4)*4;
    }



    results=[[],[],'Hardy'];//[[[],[[]]],['','','','','',''],'']
    var c = 0;//tot = 7884240;
    var papablenatures = this.so_choiceNatures();
    if (isNatureFixed) papablenatures = [document.getElementById('monitornature').value];
    var lasthp, termination = [Math.min(252,256 - points_fixed_in_speed), points_fixed_in_speed === 0 ? 4 : 0];
    var action = function (hp,at,df,sa,ds,nextIteration) {
        //QUI
        papablenatures.forEach(natura => {
                so_subject_pkmn.nature = natura;
                var partial = so_damageForAllConstraints(hp,at,df,sa,ds,[allowrollsatt, allowrollsdef],field);
                if (partial[1].every(c => c >= 0)) 
                    if (results[0][0] === undefined || results[0][0][0] > partial[0][0]) 
                        {
                            results = [partial, [hp,at,df,sa,ds], natura];
                        }
            });
        //QUI
        c++;
        if (hp !== lasthp)
        {        
            lasthp = hp;    
            var mod = [hp,at,df,sa,ds]; 
            mod[nextIteration]+=4; 
            mod[nextIteration+1] = 0;
            startLoopAt(mod[0],mod[1],mod[2],mod[3],mod[4]);
            return false;
        }
        
        if (hp === 252 && at === termination[0] && df === termination[1]) {

            if (results[0].length > 0 && results[1].length > 0) {
                so_subject_pkmn.nature = results[2]; 
                document.getElementById('monitornature').value = results[2];
                this.activeField = field;
                so_report(results[1][0],results[1][1],results[1][2],results[1][3],results[1][4],(points_fixed_in_speed),allowrollsatt,allowrollsdef);
                document.getElementById('reportscreen').innerHTML= '<span style="font-size:small"><span style="color:#7F7">The very best spread:</span><span style="color:#AAA;"> N. ' + so_subject_pkmn.nature + ' - ' + results[1].join('/') + '/'+ (points_fixed_in_speed) + ' </span>';
                this.lastbestspread = [results[1][0],results[1][1],results[1][2],results[1][3],results[1][4],(points_fixed_in_speed),results[2],document.getElementById('reportscreen').innerHTML,results[0][0][0]];
            }
            else alert("Does not exists any spread fulfilling your constraints.");
            this.so_subject_pkmn.isDynamax = wasdyna;
            this.so_subject_pkmn.moves.forEach(move => { move.isMax = wasdyna;});
            
        }
        if (this.terminateFullSearch) return false;
        return true;
    }

    function startLoopAt(hp_start,at_start,df_start,sa_start,ds_start) {
            step = Math.round((hp_start / 252)*100,2);
            modalC.innerHTML = '<div id="reportscreen"><span style="color:#AAA">Scanning all the possible spreads... '+step+'%</span></div><hr><br><progress style="width:100%" id="progress" value="'+step+'" max="100">'+step+'%</progress>';

            setTimeout(function () {
                    hp=0, at=0, df=0, sa=0, ds=0, sp = points_fixed_in_speed;
                    for (hp = hp_start; hp <= 252; hp+=4){                
                        for (at = at_start; at <= 252; at+=4) {
                        if (hp + at === 508 - sp) {if (!action(hp, at, 0, 0, 0, 0)) return; break;}
                        for (df = df_start; df <= 252; df+=4) {
                            if (hp + at + df === 508 - sp) {if (!action(hp, at, df, 0, 0, 1)) return; break;}
                            for (sa = sa_start; sa <= 252; sa+=4){

                            if (hp + at + df + sa === 508 - sp) {if (!action(hp, at, df, sa, 0, 2)) return; break;}
                            for (ds = ds_start; ds <= 252; ds+=4){

                                if (hp + at +df + sa + ds === 508 - sp) {if (!action(hp, at, df, sa, ds, 3)) return; break;}  
                                
                            }   
                            ds_start = 0;
                            }
                            sa_start = 0;
                        }
                        df_start = 0;
                        }
                    at_start = 0;
                    }
                hp_start = 0;
            },0);    
        }
    startLoopAt(0,0,0,0,0);    
    


}

    function so_loadStarterPack() {
                so_import(JSON.stringify(so_starterPack));
    }





